import { Container } from 'react-bootstrap'
import Head from "./components/Head";

function App() {
  return (
    <div>
      <Head />
      <main>
        <Container>
          <h1> Welcome!</h1>
        </Container>
      </main>
    </div>
  )
}

export default App;
